import React from 'react';
import oCard from './oCard';

const Overview = ({oview,small}) => {
    return(
        <div className='overview'>
<h1 style={{color:oview}}>
    Overview - Today
</h1>
<div className='overviewGrid'>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
<oCard smallText={small}/>
</div>
        </div>
    )
}

export default Overview;
